      def self.perform
        new.load
      end

      def load
        @vendor_cache = init_vendor_cache

        External::XPDM::Vendor.in_batches(load: true) do |pdm_vendors|
          results = []
          pdm_vendors.each do |pdm_vendor|
            results << build_concept_vendor(pdm_vendor)
          end

          CatModels::ConceptVendor.transaction { results.each(&:save!) }
        end
      end

      def load_missing
        @vendor_cache = init_vendor_cache
        External::XPDM::VendorView.current_missing.each do |pdm_vendor|
          vendor = build_concept_vendor(pdm_vendor)
          if vendor.valid?
            vendor.save
          else
            Rails.logger.error "Invalid vendor: #{pdm_vendor.vendor_num} (#{pdm_vendor.vendor_name})"
          end
        end
      end

      private

      def build_concept_vendor(vendor)
        CatModels::ConceptVendor
          .new(concept: concept, source_vendor_id: vendor.vendor_num, name: vendor.vendor_name,
               vendor: find_or_build_vendor(vendor.vendor_num, vendor.vendor_name),
               source_created_at: vendor.source_created_at, source_updated_at: vendor.source_updated_at)
      end

      def concept
        @concept ||= CatModels::Concept.find(99)
      end

      def find_or_build_vendor(jda_id, name)
        @vendor_cache.fetch(jda_id, CatModels::Vendor.new(name: name))
      end

      # use OKL concept vendors to get from jda Id to catalog vendor Id
      def init_vendor_cache
        vendors = CatModels::Vendor.all.index_by(&:vendor_id)
        CatModels::ConceptVendor.where(source_vendor_id: OKL_TO_JDA_MAPPING.keys)
                                .pluck(:source_vendor_id, :vendor_id)
                                .each_with_object({}) do |okl_and_catalog, memo|
          okl_vendor_id = okl_and_catalog.first
          catalog_vendor_id = okl_and_catalog.second

          jda_vendor_id = OKL_TO_JDA_MAPPING[okl_vendor_id]
          vendor = vendors[catalog_vendor_id]
          memo[jda_vendor_id] = vendor
        end
      end
    end
  end
end
